import React, {Component} from 'react';

import './shoppage.style.scss';

import ShopData from './shopdata';

class ShopPage extends Component {
    constructor() {
        super();

        this.state = {
            collections : ShopData,
        }
    }



    render() {
        return (
            <div>
                SHOP PAGE
            </div>
        )
    }
}

export default ShopPage;
